Requirements:%s
in order to make it work, you have to pass an identifier which uniquely identifies customer (for example his email)
in the data1 parameter in the sale/lead tracking code.
%s
For example:%s
How it works:
%s
%sIf customer is referred by an affiliate for the first time, the plugin will store the relation between customer (his identifier) and affiliate into the database%s
%sNext time, when the same customer makes a sale (with the same identifier), the application will find the affiliate who originally referred him, and give him commission%s
%sIf no affiliate is found, the process goes normally, so it tries to recognize affiliate from cookie, etc.%s'=>'%sDenne plugin slår på livstids refererere.%s
Krav:%s
for å få det til å fungere må du passere noen identifiserere som unik identifiserer kunden (f.eks hannes email)
i data1 parameter i salg/anfører sporings kode.
%s
Eksempel:%s
Hvordan fungerer det:
%s
%sHvis kunden er referert av en affiliate for første gang, vil plugin lagre relasjonen mellom kunde (hannes identifiserer) og affiliate til databasen%s
%sNeste gang den samme kunden blir referert (med samme identifiserer), vil det finne affiliaten som opprinnelig refererte ham og gi han provisjon%s
