'This campaign is still not saved and not active. 
If you completed the configuration, you can finish it using the button below.
Finization means that the campaign will be save and becomes active in the system.'=>'Denne kampanjen er fortsatt ikke lagret og ikke aktiv. 
Hvis du har fullført konfigurasjonen, kan du fullføre den ved å bruke knappen nedenfor. Sluttføring betyr at kampanjen vil bli lagret og aktiv i systemet.',
'Here you can change the names of tracking parameters that are used in affiliate URLs.
    For example, instead of www.yoursite.com/?<strong>a_aid</strong>=12345<br/>
    you can have www.yoursite.com/?<strong>ref</strong>=12345 or any name of your choice.<br/>
    Note: If you change parameter names, you should tell your affiliates to change their existing links because old parameter names will not work.
	<br/>
    It is recommended to keep default parameter names if you don\'t have any reason to change it.'=>'Her kan du endre navnene på sporingsparametre som brukes i affiliate URLs.
    For eksempel, istedet for www.minside.no/?<strong>a_aid</strong>=12345<br/>
    kan du ha www.minside.no/?<strong>ref</strong>=12345 eller et annet valgfritt navn.<br/>
    Merk: Hvis du endrer parameternavn, bør du fortelle dine affiliater å endre deres eksisterende linker, fordi gamle parameternavn ikke vil fungere.
	<br/>
    Det anbefales å bruke standard navn på parameter hvis du ikke har noen grunn til å endre den.',
'<h3>Signup Form design</h3>
The design can be divided into several parts. The form itself is displayed using template. Look of the whole page is controlled by theme and it\'s templates.'=>'<h3>Design av påmeldingsskjema</h3>
Designen kan deles inn i flere deler. Skjemaet i seg selv er vist gjennom templaten. Utseendet av hele siden er kontrollert av theme og dens template.',
'First row of graph represents how sale commission is divided between first affiliate, 
    last affiliate and other affiliates.'=>'Første rad i grafen representerer hvordan salgs provisjonen er dividert mellom første affiliate, 
    siste affiliate og andre affiliater.',
'Second row represents which part of commissions is divided between all 
    affiliates and which part is directyly added to first and last affiliates.'=>'Andre rad representerer hvilken part av provisjon er dividert mellom alle affiliater og hvilken part er lagt til direkte som første og siste affiliater.',
'You can see that commission for first(last) affiliate is not just first(last) click 
    bonus but also part of "commissions for others" is added to it.'=>'Du kan se at provisjoner for første(siste) affiliate ikke er for kun første(siste) klikk 
    bonus men også en del av "provisjoner for andre" er lagt til i den.',
'If you want to change commissions rewarding you can set it in 
<b>Campaign Edit</b> -> <b>Commission Settings</b> -> <b>Sale Edit</b>.'=>'Hvis du ønsker å endre provisjons fortjenester kan du endre det i 
<b>Rediger Kampanje</b> -> <b>Provisjons Innstillinger</b> -> <b>Rediger Salg</b>.',
'Before continuing with troubleshooting, make sure you performed <b>Clicks tracking</b> and <b>Sale tracking</b> integration and
that the tracking codes are on the respective pages.'=>'Før du fortsetter med problemløsing, forsikre deg om at du utfører <b>Klikk sporing</b> og <b>Salg sporing</b> integrasjon og
at sporings kodene er på de respektive sidene.',
'<b>Post Affiliate</b> offers powerful debugging tool that allows you to investigate every 
step of affiliate software during the tracking process.'=>'<b>Post Affiliate</b> tilbyr kraftfull debugging verktøy som lar deg utforske enhver 
steg av affiliate programmet under sporings prosessen.',
'If you don\'t see any new lines in the log, it means that the tracking code was not called at all, 
so your JavaScript was probably not on the right place.'=>'Hvis du ikke ser noen nye linjer i loggen, betyr det at sporingskoden ikke ble kalt i det hele tatt,
slik at JavaScript sannsynligvis ikke var på rett sted.',
